    }
  }

  render(){
    return(
      <div id='App'>
        <BrowserRouter>
            <Routes>
              <Route path='/' element={<Start/>}/>
              <Route path='/main' element={<Main/>}/>
              <Route path='/membership' element={<Membership/>}/>
            </Routes>   
        </BrowserRouter> 
      </div>
    )
  }
}

export default App;
